(201, 1, '2020-06-30 19:43:00', '2020-06-30 19:43:00', '<!-- wp:paragraph -->\n<p>Liberty Aluminium &amp; Glass is a professional company specialized in the import and wholesale of aluminium and glass accessories.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are based in the New Industrial Area of Ajman and have almost a decade of trading expertise to offer our customers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our operations also span design, engineering, and the supply, manufacture and installation of various types of architectural aluminium, glass and metal works.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Liberty\'s wholesale supply activities cover both the local and the Middle East markets with a product range that has accessories for aluminium doors and windows, ï¬oor hinges, door closers, sliding locks, hinges, handles, rollers, sandwich panels, screws and rivets to list a few.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The products we provide are further complemented by our qualiï¬ed sales and marketing teams as well as our technical support staff.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When you are looking for a superior quality and standard, then look no further than Liberty Aluminium &amp; Glass â your satisfaction is ensured with us.</p>\n<!-- /wp:paragraph -->', 'About Us', '', 'inherit', 'closed', 'closed', '', '139-revision-v1', '', '', '2020-06-30 19:43:00', '2020-06-30 19:43:00', '', 139, 'http://localhost:8080/hms/2020/06/30/139-revision-v1/', 0, 'revision', '', 0),
(202, 1, '2020-06-30 19:49:19', '2020-06-30 19:49:19', '<!-- wp:paragraph -->\n<p>Our operations also span design, engineering, and the supply, manufacture and installation of various types of architectural aluminium, glass and metal works.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The products we provide are further complemented by our qualiï¬ed sales and marketing teams as well as our technical support staff.</p>\n<!-- /wp:paragraph -->', 'About Us', '', 'inherit', 'closed', 'closed', '', '139-revision-v1', '', '', '2020-06-30 19:49:19', '2020-06-30 19:49:19', '', 139, 'http://localhost:8080/hms/2020/06/30/139-revision-v1/', 0, 'revision', '', 0),
